return(
<>
<img src="" alt="movie image" />
<h3>{mname}</h3>
<p>{mrating}</p>
<p>{lastupdate}</p>
<p>{mprice}</p>
<p>{mreleasedatetime}</p>
<p>{mtime}</p>
</>)
}

